import { useEffect, useState } from "react";
import { getHotels, bookHotel } from "../services/api";
import { useAuth } from "../context/AuthContext";
import { toast } from "react-toastify";

export default function Hotels() {
  const [hotels, setHotels] = useState([]);
  const { user } = useAuth();
  const [showModal, setShowModal] = useState(false);
  const [selectedHotel, setSelectedHotel] = useState(null);
  const [formData, setFormData] = useState({
    name: "",
    family_member: "",
    days: "",
  });

  useEffect(() => {
    getHotels().then((res) => {
      const hotelsWithImages = res.data.map((hotel) => ({
        ...hotel,
        imageUrl: hotelImages[hotel.name],
      }));
      setHotels(hotelsWithImages);
    });
  }, []);

  const hotelImages = {
    "Taj Hotel":
      "data:image/jpeg;base64,",
    "Oberoi":
      "data:image/jpeg;base64,",
    "ITC Maurya":
      "data:image/jpeg;base64,",
    "Leela Palace":
      "data:image/jpeg;base64,",
      "Trident":"data:image/jpeg;base64,",
      "The Lalit":"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTFX9_xU69KuVpV3n6XtRVHMiOtFglqqidilw&s",
      "Radisson Blu":"data:image/jpeg;base64,",
      "Hyatt Regency":"data:image/jpeg;base64,",
      "Marriott":"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSmME4I1cMRnqAs1-nJTVHmmXF8EycPFfSUEA&s",
      "The Park":"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQQ8C11tjFAMBBYRKQDvI-5Wt8FhBN3Ol5f5Q&s"
  };

  const openModal = (hotel) => {
    setSelectedHotel(hotel);
    setShowModal(true);
  };

  const closeModal = () => {
    setShowModal(false);
    setFormData({ name: "", family_member: "", days: "" });
  };

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleBooking = async () => {
    if (!user) return toast.warning("Please log in to book a hotel.");
    if (!formData.name || !formData.family_member || !formData.days) {
      toast.warning(`All fields are required`);
      return ;
    }

    try {
      await bookHotel({ hotelId: selectedHotel.id });
      toast.success(`Hotel "${selectedHotel.name}" booked successfully!`);
      closeModal();
    } catch (error) {
      console.error("Booking failed:", error);
    }
  };

  return (
    <div className="p-5">
      <h2 className="text-2xl font-bold mb-4 text-center">Available Hotels</h2>
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4">
        {hotels.map((hotel) => (
          <div key={hotel.id} className="border p-2 rounded shadow flex gap-10">
            <div>
              <h3 className="text-lg font-semibold">{hotel.name}</h3>
              <p>{hotel.location}</p>
              <p>₹{hotel.price_per_night} per night</p>
              <button
                className="bg-green-500 text-white px-4 py-2 rounded mt-2 cursor-pointer"
                onClick={() => openModal(hotel)}
              >
                Book Now
              </button>
            </div>
            <div className="">
              <img
                src={hotel.imageUrl}
                alt={hotel.name}
                className="w-full h-32 object-cover rounded"
              />
            </div>
          </div>
        ))}
      </div>
      {showModal && (
        <div className="fixed inset-0 flex items-center justify-center bg-gray-400 bg-opacity-50">
          <div className="bg-white p-6 rounded-lg shadow-lg w-96">
            <div className="">
            <h2 className="text-xl font-semibold mb-4">
              Book {selectedHotel?.name}
            </h2>
            <img
              src={selectedHotel?.imageUrl}
              alt={selectedHotel?.name}
              className="w-full h-32 object-cover rounded"
            />
              </div>

            <div className="mb-2">
              <label className="block text-gray-600 font-semibold mb-1">
                Name
              </label>
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
                className="w-full border border-gray-400 p-2 rounded focus:outline-none focus:ring-2 focus:ring-green-500"
                placeholder="Enter your name"
              />
            </div>

            <div className="mb-2">
              <label className="block text-gray-600 font-semibold mb-1">
                No of family member
              </label>
              <input
                type="text"
                name="family_member"
                value={formData.family_member}
                onChange={handleChange}
                className="w-full border border-gray-400 p-2 rounded focus:outline-none focus:ring-2 focus:ring-green-500"
                placeholder="Enter number of family member"
              />
            </div>

            <div className="mb-4">
              <label className="block text-gray-600 font-semibold mb-1">
                For How Many Days
              </label>
              <input
                type="number"
                name="days"
                value={formData.days}
                onChange={handleChange}
                className=" w-full border border-gray-400 p-2 rounded focus:outline-none focus:ring-2 focus:ring-green-500"
                placeholder="Enter number of days"
              />
            </div>

            <div className="flex justify-around gap-3">
              <button
                className="bg-gray-400 cursor-pointer text-white px-4 py-2 rounded"
                onClick={closeModal}
              >
                Cancel
              </button>
              <button
                className="bg-green-500 cursor-pointer text-white px-4 py-2 rounded"
                onClick={handleBooking}
              >
                Confirm Booking
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}
